import React from "react";

export default function TableRecords({
  apagarRegistros,
  filtrarRegistros,
  Button,
}) {
  return (
    <>
      {registros?.length >= 1 && (
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>#</th>
              <th>Titulo</th>
              <th>Detalhes</th>
            </tr>
          </thead>

          <tbody>
            {registros.map((registro) => {
              return (
                <tr>
                  <td>{registro.id}</td>
                  <td>{registro.title}</td>
                  <td>
                    {" "}
                    <Button variant="warning" href={`${registro.id}`}>
                      Visualizar
                    </Button>
                  </td>
                </tr>
              );
            })}
          </tbody>
        </Table>
      )}
    </>
  );
}
